import axios from "axios"
import {global} from 'Configure.js'


class EduStatusService {

    getAllEduStatus() {
        return axios.get(global.HOST + '/get-designations')
    }

    deleteEduStatus(id) {
        return axios.delete(global.HOST + `/delete-designation/${id}`)
    }


    updateEduStatus(edustatus) {
        return axios.put(global.HOST + '/update-designation',edustatus)
    }

    addEduStatus(designation) {
        return axios.post(global.HOST + '/add-designation',edustatus)
    }
    
}

export default new EduStatusService()
